import React from "react";

function LoginForm(props) {

    return (
        <form action="" onClick={(e)=>{
            e.preventDefault()

        }}>
            <div className="form">

                <h4>
                    Login
                </h4>

                <label>Your Email</label>
                <br />
                <input type="email" placeholder="enter your pass"/>
                <label>Your Password</label>
                <br />
                <input type="password" placeholder="enter your pass"/>
                <br /><br />
                <button>Login</button>
                <br />
                <p onClick={() => {
                    props.chgForm()
                }}>Create new account</p>

            </div>
        </form>

    );
}
export default LoginForm
